t.exports='---changelog---\ndate: "2022-12-07"\nlocale: "en-US"\nrevision: 1\nyoutube_video_id: "U0gEQNf8Hxw"\n---\nIt’s Snow Time {added marginTop}\n======================\n\n* **Snowsgiving has arrived!** Every year we celebrate the holiday season by raising funds for charity and sharing some cheer with our amazing community. [Visit our website](https://discord.com/snowsgiving) for daily drops, Nitro exclusives, and one extra special surprise on 12/13. (Hint: you’ll probably want a front row seat.)\n* **New merch for a good cause.** We’re donating 100% of this month’s profits from our limited [Snowsgiving collection](https://bit.ly/3P1FCww) to our partner Crisis Text Line.\n* **Activities got the holiday spirit.** Pop into any voice channel to try winter themed Bobble League on Ice. Nitro subscribers can also launch snowy Sketch Heads, Chess, and Checkers. [Learn more](https://discord.com/blog/server-activities-games-voice-watch-together).\n\n\n---changelog---\ndate: "2022-11-01"\nlocale: "bg-bg"\nrevision: 1\nyoutube_video_id: "8jD0dkCgF7k"\n---\nНови функции {added marginTop}\n======================\n\n* **„Дейности“ са вече тук.** Влез в който и да е гласов канал и веднага можеш да изстреляш (все едно си на космически кораб) някой плейлист в Watch Together или игра Putt Party, за да си прекарате приятно. Имаш Nitro? Значи ще получиш целия каталог с „Дейности“ и тежката задача да се изфукаш пред приятелите си. [В блога](https://discord.com/blog/server-activities-games-voice-watch-together) можеш да прочетеш всички подробности. \n* **Представяме Nitro Basic.** Нашата най-мини версия на Nitro, но за още по-мини цена. Отключваш всички емоджита навсякъде, качваш по-големи файлове и още много други. Вече е достъпно в повечето страни, а в останалите – скоро.\n* **Нов бонус в Nitro: профилни теми.** Избери цветова схема, която да акцентира профила ти. Скоро тази опция ще е налична в „Потребителски настройки“ за всички, които имат Nitro.\n* **Насам, насам, народе! Форумните канали са вече тук, ура!** Нашия прочит на една класика. Освободи се от оковите на единичните теми, защото в себе си всеки таи какви ли не мисли.\n* **Добави приложения към сървъра си директно от [App Directory](https://discord.com/blog/app-directory-is-here-mods-and-admins).** Общността от разработчици на Discord прави страхотни неща, които карат сървъра ти да работи за теб. И по едно време си помислихме: „Всъщност не трябва ли такива неща да могат да се намират по-лесно?“. И ето ги. Ако управляваш сървър, отиди на „Настройки на сървъра“, за да видиш за какво става дума.\n* **Discord Voice за Xbox вече е тук и е достъпен за всички.** ДА, СЕРИОЗНО! Приятелите ти могат да видят какви игри играеш в конзолата си и ВЕЧЕ МОЖЕШ ДА ГОВОРИШ В DISCORD VOICE ОТ XBOX-A СИ, ТОЧНО КАКТО ИСКАШЕ ОТ ГОДИНИ НАСАМ. БЛАГОДАРИМ ТИ ЗА ТЪРПЕНИЕТО. Научи повече в [блога](https://dis.gd/xbox-voice). \n\nАктуализации по настройките {progress}\n======================\n\n* **Случайните съобщения вече се филтрират.** Ако някой, който не е сред приятелите ти, ти изпрати директно съобщение, можеш да го видиш в отделна папка „Заявки за съобщения“. Ако нямаш против да получаваш съобщения от всякакви хора, можеш да [изключиш тази опция](https://support.discord.com/hc/articles/7924992471191-Message-Requests).\n* **Можеш да управляваш известията си за акценти.** Бъди в течение на това, което се случва в любимите ти сървъри – [или пък не](https://support.discord.com/hc/articles/5304469213079-Highlights-Notifications), ако не искаш. Ти си решаваш.\n* **Още по-безотказно засичане на спам в сървърите на общността.** Ако някой се опитва да спами с @mentions или да публикува връзка с цел измама, AutoMod може да блокира съобщението и то да не се публикува. Администраторите на общността могат да управляват това от настройките на сървъра.\n* **Преглед на устройствата, в които сте логнати.** Провери в „Потребителски настройки > Устройства“ – чудесно място, където можеш да се спасиш от семейния компютър или от стария телефон на сто милиона години.\n\n\n---changelog---\ndate: "2022-11-01"\nlocale: "cs-cz"\nrevision: 1\nyoutube_video_id: "8jD0dkCgF7k"\n---\nNové funkce {added marginTop}\n======================\n\n* **Aktivity dorazily na party.** Naskoč do libovolného hlasového kanálu a rychlostí blesku začni přehrávat seznam skladeb Watch Together nebo nahoď hru Putt Party a bav se ještě líp než kdy předtím. Máš Nitro? Pak si můžeš vybrat z kompletního katalogu aktivit a pochlubit se některou z nich svým přátelům. Podrobné informace najdeš [na blogu](https://discord.com/blog/server-activities-games-voice-watch-together). \n* **Představujeme Nitro Basic.** Tohle je naše nejmenší verze Nitra za ještě menší cenu. Odemkni všechny smajlíky na všech serverech, nahrávej větší soubory a užij si řadu dalších výhod. Tuto nabídku aktuálně můžeš využít ve většině zemí a další budou brzy následovat.\n* **Nové vylepšení Nitra: Motivy profilu.** Vyber si barevný motiv, kterým oživíš svůj profil. Pokud máš Nitro, pak co nevidět tuto možnost uvidíš v části Uživatelská nastavení.\n* **Slyšte, slyšte… Kanály pro fóra jsou tady!** Nehynoucí klasika v našem podání. Máš plnou hlavu nápadů? Pak se nenech svazovat omezením jediného tématu, a dej svým myšlenkám volný průchod.\n* **Naplň svůj server aplikacemi přímo z nového [App Directory](https://discord.com/blog/app-directory-is-here-mods-and-admins).** Komunita vývojářů na Discordu vyváří skvělé věci, díky kterým tvůj server funguje jako švýcarské hodinky. Napadlo nás, že by bylo dobré mít k těmto věcem snazší přístup. A tak jsme to prostě zařídili. Jestli si chceš usnadnit správu svého serveru, mrkni do Nastavení serveru.\n* **Discord Voice na Xboxu je tu nyní pro všechny.** ANO, MYSLÍM TO VÁŽNĚ. Přátelé uvidí, jakou hru právě hraješ na své nabušené konzoli, a TY SI BUDEŠ MOCT POVÍDAT PROSTŘEDNICTVÍM HLASOVÝCH SLUŽEB DISCORDU ZE SVÉHO XBOXU TAK, JAK O TOM UŽ CELÉ ROKY TOUŽÍŠ. DĚKUJEME ZA TRPĚLIVOST. Další informace se dozvíš [na blogu](https://dis.gd/xbox-voice). \n\nAktualizace nastavení {progress}\n======================\n\n* **Náhodné zprávy se odteď filtrují.** Když ti někdo nezařazený na seznam tvých přátel pošle PZ, uvidíš ji v samostatné složce Žádosti o zprávy. Jestli ti náhodné zprávy od kohokoli nevadí, můžeš filtrování [vypnout](https://support.discord.com/hc/articles/7924992471191-Message-Requests).\n* **Spravuj oznámení týkající se doporučeného obsahu.** Měj přehled o tom, co se děje na tvých oblíbených serverech – anebo [neměj](https://support.discord.com/hc/articles/5304469213079-Highlights-Notifications), pokud o to nemáš zájem. Je to jenom na tobě.\n* **Nelítostná detekce spamu na komunitních serverech.** Když se někdo pokusí spamovat @zmínkami nebo zveřejnit podvodný odkaz, funkce AutoMod může takovou zprávu zablokovat. Správci komunity mohou toto nastavení spravovat v části Nastavení serveru.\n* **Sleduj, na kterých zařízeních je aktivní tvoje přihlášení.** Přejdi do části Uživatelská nastavení › Zařízení. Sice ti neukáže, kdo je v zemi zdejší nejhezčí a nejkrásnější, ale můžeš se tady z libovolného zařízení odhlásit – ať už je to tvůj výkonný rodinný počítač nebo prehistorický telefon.\n\n\n---changelog---\ndate: "2022-11-01"\nlocale: "da-da"\nrevision: 1\nyoutube_video_id: "8jD0dkCgF7k"\n---\nNye funktioner {added marginTop}\n======================\n\n* **Aktiviteter er klar til affyring.** Når du åbner en talekanal, kan du nu straks starte en Watch Together-playliste eller et Putt Party-spil og hænge ud sammen og hygge. Har du Nitro? Så får du hele kataloget af Aktiviteter og den tunge byrde at give dine venner en god oplevelse! [Bloggen](https://discord.com/blog/server-activities-games-voice-watch-together) har den fulde historie. \n* **Vi lancerer nu Nitro Basic.** Vores mindste version af Nitro til en endnu mindre pris. Lås op for alle emoji overalt, upload større filer og meget mere. Fås nu i de fleste lande, og flere kommer løbende til.\n* **Nyt Nitro-frynsegode: Profiltemaer.** Vælg et farveskema for at fremhæve din profil. Snart tilgængelig under Brugerindstillinger for alle, der har Nitro.\n* **Forumkanaler er nu landet.** Vores bud på en klassiker. Befri dig selv fra de bånd, som et enkelt emne giver, for du er et komplekst menneske og har tanker om alt mellem himmel og jord.\n* **Føj apps til din server direkte fra det nye [App Directory](https://discord.com/blog/app-directory-is-here-mods-and-admins).** Vores community af Discord-udviklere bygger fantastiske ting, der får din server til at arbejde for dig. Og vi tænkte, at det burde være nemmere at finde alt det. Så det er det nu. Hvis du administrerer en server, kan du gå til Serverindstillinger for se det hele.\n* **Discord Voice på Xbox er nu tilgængelig for alle.** JA, DET ER FAKTISK SANDT. Venner kan se, hvilket spil du spiller på din konsol, og DU KAN NU BRUGE DISCORD VOICE FRA DIN XBOX TIL AT TALE MED DEM, PRÆCIS SOM I HAR EFTERSPURGT I ÅREVIS. TAK FOR JERES TÅLMODIGHED. Få mere at vide på [bloggen](https://dis.gd/xbox-voice). \n\nOpdateringer af indstillinger {progress}\n======================\n\n* **Tilfældige beskeder filtreres nu.** Hvis en person, du ikke er venner med, sender dig en direkte besked, kan du se den i en separat mappe til beskedanmodninger. Hvis du ikke har noget imod at kunne modtage beskeder fra hvem som helst, kan du [slå det fra](https://support.discord.com/hc/articles/7924992471191-Message-Requests).\n* **Du kan administrere dine fremhævelser af meddelelser.** Følg med i, hvad der sker på dine yndlingsservere – eller [lad være](https://support.discord.com/hc/articles/5304469213079-Highlights-Notifications), hvis du ikke bryder dig om det. Det afgør du selv.\n* **Der er indført en bedre registrering af spam på community-servere.** Hvis nogen forsøger at spamme @mentions eller lave et opslag, der linker til svindel, kan AutoMod forhindre, at beskeden sendes. Community-administratorer kan håndtere funktionen under serverindstillinger.\n* **Vis enheder, hvor du er logget ind.** Gå til Brugerindstillinger › Enheder for at opleve et vidunderligt sted, hvor du kan logge af familiens computer eller en oldnordisk telefon.\n\n\n---changelog---\ndate: "2022-11-01"\nlocale: "nl"\nrevision: 1\nyoutube_video_id: "8jD0dkCgF7k"\n---\nNieuwe functies {added marginTop}\n======================\n\n* **Check onze nieuwste aanwinst: Activiteiten.** Duik in een willekeurig spraakkanaal en lanceer direct (want raket, jeweetwel) een Watch Together-afspeellijst of een potje Putt Party om de sfeer te verhogen. Heb je Nitro? Dan ontvang je de complete Activiteitencatalogus en de zware last om je vrienden ermee de ogen uit te steken. In de [blog](https://discord.com/blog/server-activities-games-voice-watch-together) vind je alle informatie. \n* **We presenteren Nitro Basic.** Onze kleinste versie van Nitro, voor een nog kleinere prijs. Ontgrendel alle emoji overal, upload grotere bestanden en maak gebruik van nog meer opties. Nu verkrijgbaar in de meeste landen. Binnenkort meer info.\n* **Nieuw Nitro-voordeel: profielthema\'s.** Kies een kleurenschema om je profiel te accentueren. Binnenkort beschikbaar in de gebruikersinstellingen voor alle Nitro-abonnees.\n* **Hoort, zegt het voort. Forumkanalen zijn nu aan boord.** Onze kijk op een klassieker. Bevrijd jezelf van de ketenen van één enkel onderwerp en laat je talloze complexe gedachten de vrije loop.\n* **Voeg apps toe aan je server, direct uit de [App Directory](https://discord.com/blog/app-directory-is-here-mods-and-admins).** De Discord-ontwikkelaarscommunity bouwt toffe dingen om je server voor je aan het werk te zetten. Toen dachten wij: zouden ze niet wat makkelijker te vinden moeten zijn? En dat is nu geregeld. Als je een server beheert, ga dan naar Serverinstellingen om te kijken wat er nieuw is.\n* **Discord-spraakchat voor Xbox is nu voor iedereen beschikbaar.** JA, SERIEUS. Vrienden kunnen zien welke game je op je console speelt en JE KUNT NU DISCORD-SPRAAKCHAT GEBRUIKEN OP JE XBOX, ZOALS JULLIE AL JAREN HEBBEN GEVRAAGD. BEDANKT VOOR JULLIE GEDULD. Meer informatie vind je in de [blog](https://dis.gd/xbox-voice). \n\nInstellingenupdates {progress}\n======================\n\n* **Willekeurige berichten worden nu gefilterd.** Als iemand waar je geen vrienden mee bent je een privébericht stuurt, verschijnt dat in de aparte map Berichtenverzoeken. Als je het niet erg vindt om van iedereen berichten te kunnen ontvangen, kun je dit [uitschakelen](https://support.discord.com/hc/articles/7924992471191-Message-Requests).\n* **Je kunt Hoogtepuntmeldingen beheren.** Blijf op de hoogte wat er gebeurt op je favoriete server, of [niet](https://support.discord.com/hc/articles/5304469213079-Highlights-Notifications), als je dat liever hebt. Jij bent je eigen baas.\n* **Betere spamdetectie op communityservers.** Als iemand @mentions probeert te spammen of een verdachte link probeert te posten, kan AutoMod het bericht blokkeren zodat dat niet gebeurt. Communitybeheerders kunnen dit regelen in de Serverinstellingen.\n* **Bekijk apparaten waarop je bent ingelogd.** Check Gebruikersinstellingen › Apparaten. Op deze heerlijke plek kun je uitloggen op de gezinscomputer of op een superoude telefoon.\n\n\n---changelog---\ndate: "2022-11-01"\nlocale: "en-gb"\nrevision: 1\nyoutube_video_id: "8jD0dkCgF7k"\n---\nNew Features {added marginTop}\n======================\n\n* **Activities joined the party.** Hop into any voice channel and instantly launch (because, rocket ship — get it?) a Watch Together playlist or Putt Party game for a cosy hangout. Got Nitro? You get the full Activities catalogue and the heavy burden of flexing on your friends. The [blog](https://discord.com/blog/server-activities-games-voice-watch-together) has the full story. \n* **Introducing Nitro Basic.** Our littlest version of Nitro, for an even littler price. Unlock all emoji everywhere, upload bigger files, and more. Now in most countries, more coming soon.\n* **New Nitro perk: Profile themes.** Choose a colour scheme to accent your profile. Available soon in User settings to all whomst have Nitro.\n* **Hear ye, hear ye, Forum channels are here…yee.** Our take on a classic. Free yourself from the shackles of a single topic, for you contain multitudes and too many thoughts.\n* **Add apps to your server right from the new [App Directory](https://discord.com/blog/app-directory-is-here-mods-and-admins).** The Discord developer community builds awesome things that make your server work for you. And we were like…shouldn’t it be easier to find them? So now it is. If you manage a server, go to Server settings to check it out.\n* **Discord Voice on Xbox is now here for everyone.** YES, I’M SERIOUS. Friends can see what game you’re playing on your console and YOU CAN NOW TALK IN DISCORD VOICE FROM YOUR XBOX JUST LIKE YOU’VE BEEN REQUESTING FOR YEARS. THANK YOU FOR YOUR PATIENCE. Learn more on the [blog](https://dis.gd/xbox-voice). \n\nSettings updates {progress}\n======================\n\n* **Random messages are now filtered.** If someone you’re not friends with sends you a DM, you may see it in a separate Message requests folder. If you don’t mind messages from anyone, you can [turn it off](https://support.discord.com/hc/articles/7924992471191-Message-Requests).\n* **You can manage your Highlight notifications.** Keep up with what’s going on in your favourite servers—or [don’t](https://support.discord.com/hc/articles/5304469213079-Highlights-Notifications), if you prefer not to. You do you.\n* **Beefed up spam detection in Community servers.** If someone tries to spam @mentions or post a scam link, AutoMod can block the message from being posted. Community admins can manage this in Server settings.\n* **View devices where you’re logged in.** Check out User settings › Devices, a wonderful place where you can log out of the family computer or a million-year-old phone.\n\n\n---changelog---\ndate: "2022-11-01"\nlocale: "fi-fi"\nrevision: 1\nyoutube_video_id: "8jD0dkCgF7k"\n---\nUudet ominaisuudet {added marginTop}\n======================\n\n* **Toiminnot ottaa kierroksia.** Singahda mille tahansa puhekanavalle, laukaise saman tien liikkeelle Watch Together -toistolista tai Putt Party -peli (kuin raketti ikään) ja hengaile kaikessa rauhassa. Löytyykö Nitroa? Käytettävissäsi on koko Toiminnot-katalogi ja oi niin oiva sauma levennellä kavereille. Lue lisää [blogista](https://discord.com/blog/server-activities-games-voice-watch-together). \n* **Esittelyssä Nitro Basic.** Nitron kaikkein pikkuruisin versio, vielä pikkuriikkisempään hintaan. Avaa kaikki emojit käyttöön kaikkialla, lataa isompia tiedostoja palvelimelle ja paljon muuta. Nyt saatavana useimmissa maissa, lisää tulossa pian.\n* **Uusi Nitro-etu: profiiliteemat.** Valitse profiilia korostava väriteema. Pian kaikkien Nitron hankkineiden käytettävissä käyttäjäasetuksissa.\n* **Jee, jee, foorumikanavaa pukkaa… jee.** Oma versiomme klassikosta. Vapauta itsesi yksittäisen aiheen kahleista, sillä olethan monitahoinen itsekin ja ajatuksia täynnä.\n* **Lisää sovelluksia palvelimellesi suoraan uudesta [App Directorysta](https://discord.com/blog/app-directory-is-here-mods-and-admins).** Discordin kehittäjäyhteisö rakentaa upeita juttuja, joiden ansiosta palvelimesi palvelee sinua entistäkin paremmin. Ja me oltiin vähän niinku että… eikö niiden pitäisi olla helpompia löytää? Joten nyt ne ovat. Jos hallinnoit palvelinta, käy toteamassa asia palvelinasetuksista.\n* **Discordin puhekanavat Xboxilla ovat nyt kaikkien käytettävissä.** KYLLÄ, OLEN AIVAN TOSISSANI. Kaverit näkevät nyt, mitä peliä pelaat konsolillasi, ja VOITTE PUHUA DISCORDIN PUHEKANAVALLA XBOXILLA – JUURI NIIN KUIN ON VUOSIKAUDET TOIVOTTU. KIITOS KÄRSIVÄLLISYYDESTÄ. Lisätietoja saat [blogista](https://dis.gd/xbox-voice). \n\nAsetuksia koskevia päivityksiä {progress}\n======================\n\n* **Tästedes satunnaiset viestit suodatetaan.** Jos joku muu kuin kaveri lähettää sinulle yksityisviestin, se voi näkyä erillisessä viestipyyntöjen kansiossa. Jos otat mielelläsi vastaan viestejä keneltä hyvänsä, voit [poistaa asetuksen käytöstä](https://support.discord.com/hc/articles/7924992471191-Message-Requests).\n* **Voit hallita omia kohokohtailmoituksia.** Seuraa suosikkipalvelintesi meininkejä – tai [älä](https://support.discord.com/hc/articles/5304469213079-Highlights-Notifications) seuraa, jos ei satu miellyttämään. Tee ihan niin kuin lystäät.\n* **Entistä parempi roskapostin tunnistus yhteisöpalvelimilla.** Jos joku yrittää roskapostittaa @mainintoja tai julkaista roskalinkin, AutoMod voi estää vietin julkaisemisen. Yhteisön ylläpitäjät voivat hallita tätä palvelinasetuksissa.\n* **Katso, millä laitteilla olet kirjautuneena.** Käy vilkaisemassa Käyttäjäasetukset › Laitteet. Siellä voit kirjautua mainion kätevästi ulos perheen tietokoneelta tai tyyliin miljoona vuotta vanhasta puhelimesta.\n\n\n---changelog---\ndate: "2022-12-07"\nlocale: "fr"\nrevision: 1\nyoutube_video_id: "U0gEQNf8Hxw"\n---\nC\'est la saison de la neige {added marginTop}\n======================\n\n* **Snowsgiving est arrivé !** Chaque année, nous célébrons la fin d\'année en collectant des fonds pour des causes caritatives et en partageant un peu de joie avec notre formidable communauté. [Visitez notre site web](https://discord.com/snowsgiving) pour des drops quotidiens, des exclusivités Nitro, et une surprise spéciale le 13/12. (Avis : vous voudrez probablement être aux premières loges).\n* **De nouveaux produits pour une bonne cause ** Ce mois-ci, nous reversons 100 % des bénéfices de notre collection limitée [Snowsgiving] (https://bit.ly/3P1FCww) à notre partenaire Crisis Text Line. \n* ***Les activités ont un caractère festif. ** Connectez-vous à n\'importe quel salon vocal pour essayer la Bobble League on Ice à thème hivernal. Les abonnés à Nitro peuvent également lancer les jeux Sketch Heads, Chess et Checkers sur fond de neige. [Apprenez-en plus](https://discord.com/blog/server-activities-games-voice-watch-together).\n\n\n---changelog---\ndate: "2022-12-07"\nlocale: "de"\nrevision: 1\nyoutube_video_id: "U0gEQNf8Hxw"\n---\nEs ist Schneezeit {added marginTop}\n======================\n\n* **Snowsgiving ist da!** Jedes Jahr feiern wir die Feiertage, indem wir Spenden für wohltätige Zwecke sammeln und unsere wunderbare Community mit Freude erfüllen. [Besuche unsere Website](https://discord.com/snowsgiving) für tägliche Drops, Nitro-Exklusivitäten und eine ganz besondere Überraschung am 13.12. (Tipp: Du wirst wahrscheinlich einen Platz in der ersten Reihe wollen.)\n* **Neues Merch für einen guten Zweck** Wir spenden 100% des Gewinns aus unserer limitierten [Snowsgiving-Kollektion](https://bit.ly/3P1FCww) an unseren Partner Crisis Text Line. \n* **Aktivitäten, die für Weihnachtsstimmung sorgen.** Besuche einen beliebigen Sprachkanal, um die winterliche Bobble League on Ice auszuprobieren. Nitro-Abonnenten können auch verschneite Sketch Heads, Chess und Checkers starten. [Mehr erfahren](https://discord.com/blog/server-activities-games-voice-watch-together).\n\n\n---changelog---\ndate: "2022-11-01"\nlocale: "el-gr"\nrevision: 1\nyoutube_video_id: "8jD0dkCgF7k"\n---\nΝέες λειτουργίες {added marginTop}\n======================\n\n* **Οι Δραστηριότητες κατέφτασαν.** Μπες σε ένα κανάλι ομιλίας και ξεκίνα άμεσα μια λίστα αναπαραγωγής Watch Together ή το παιχνίδι Putt Party και χαλαρώστε όλοι μαζί παρέα. Έχεις Nitro; Αποκτάς τον πλήρη κατάλογο Δραστηριοτήτων και το βάρος της επίδειξης στους φίλους σου. Στο [blog](https://discord.com/blog/server-activities-games-voice-watch-together) μπορείς να διαβάσεις όλες τις λεπτομέρειες. \n* **Παρουσιάζουμε το Nitro Basic.** Τη μικρότερη έκδοση του Nitro, για ακόμη μικρότερη τιμή. Ξεκλείδωσε όλα τα emoji παντού, μεταφόρτωσε μεγαλύτερα αρχεία και πολλά άλλα. Τώρα διαθέσιμο στις περισσότερες χώρες, σύντομα σε ακόμη περισσότερες.\n* **Νέο προνόμιο Nitro: Θέματα προφίλ.** Επίλεξε έναν συνδυασμό χρωμάτων για να τονίσεις το προφίλ σου. Σύντομα διαθέσιμο στις Ρυθμίσεις χρήστη σε όλους τους συνδρομητές Nitro.\n* **Ακούσατε, ακούσατε, τα Κανάλια φόρουμ είναι εδώ…Ναι!** Η δική μας εκδοχή του κλασικού. Απελευθερώσου από τα δεσμά ενός και μόνο θέματος, διότι το μυαλό σου κατακλύζεται από τόσες και τόσες σκέψεις.\n* **Πρόσθεσε εφαρμογές στον διακομιστή σου από το νέο [App Directory](https://discord.com/blog/app-directory-is-here-mods-and-admins).** Η κοινότητα Προγραμματιστών του Discord φτιάχνει απίστευτα πράγματα που εξυπηρετούν εσένα και τον διακομιστή σου. Και εμείς σκεφτόμαστε…δεν θα έπρεπε να ήταν ευκολότερο να τα βρίσκεις; Οπότε, τώρα είναι. Αν διαχειρίζεσαι έναν διακομιστή, πήγαινε στις Ρυθμίσεις διακομιστή για να ρίξεις μια ματιά.\n* **Τώρα η φωνητική συνομιλία Discord από το Xbox είναι εδώ για όλους.** ΝΑΙ, ΣΟΒΑΡΟΛΟΓΩ. Οι φίλοι σου θα μπορούν να δουν ποιο παιχνίδι παίζεις στην κονσόλα σου και ΠΛΕΟΝ ΘΑ ΜΠΟΡΕΙΤΕ ΝΑ ΜΙΛΑΤΕ ΜΕ ΦΩΝΗΤΙΚΗ ΣΥΝΟΜΙΛΙΑ DISCORD ΑΠΟ ΤΟ XBOX ΣΟΥ, ΟΠΩΣ ΜΑΣ ΤΟ ΖΗΤΑΤΕ ΕΔΩ ΚΑΙ ΧΡΟΝΙΑ. ΕΥΧΑΡΙΣΤΟΥΜΕ ΓΙΑ ΤΗΝ ΥΠΟΜΟΝΗ. Μάθε περισσότερα στο [blog](https://dis.gd/xbox-voice). \n\nΕνημερώσεις ρυθμίσεων {progress}\n======================\n\n* **Τώρα τα τυχαία μηνύματα φιλτράρονται.** Αν κάποιος με τον οποίο δεν είστε φίλοι σού στείλει ΑΜ, μπορείς να το δεις σε έναν ξεχωριστό φάκελο Αιτημάτων μηνυμάτων. Αν δεν σε πειράζει να λαμβάνεις μηνύματα από οποιονδήποτε, μπορείς να το [απενεργοποιήσεις](https://support.discord.com/hc/articles/7924992471191-Message-Requests).\n* **Μπορείς να διαχειριστείς τις ειδοποιήσεις Επισημάνσεων.** Μάθε τι συμβαίνει στους αγαπημένους σου διακομιστές—ή [και όχι](https://support.discord.com/hc/articles/5304469213079-Highlights-Notifications), αν δεν σου αρέσει αυτό. Όπως προτιμάς.\n* **Ενισχύσαμε τον εντοπισμό ανεπιθύμητης αλληλογραφίας στους διακομιστές Κοινότητας.** Αν κάποιος προσπαθήσει να στείλει ανεπιθύμητη αλληλογραφία με @mentions ή να δημοσιεύσει έναν σύνδεσμο απάτης, το AutoMod μπορεί να αποκλείσει τη δημοσίευση του μηνύματος. Οι διαχειριστές κοινότητας μπορούν να επεξεργαστούν αυτή τη δυνατότητα στις Ρυθμίσεις διακομιστή.\n* **Δες τις συσκευές στις οποίες είσαι συνδεδεμένος.** Τσέκαρε τις Ρυθμίσεις χρήστη › Συσκευές, ένα υπέροχο μέρος όπου μπορείς να αποσυνδεθείς από τον οικογενειακό υπολογιστή ή από ένα πανάρχαιο τηλέφωνο.\n\n\n---changelog---\ndate: "2022-11-01"\nlocale: "hi-in"\nrevision: 1\nyoutube_video_id: "8jD0dkCgF7k"\n---\nनई सुविधाएं {added marginTop}\n======================\n\n* **अब एक्टिविटी का भी मज़ा लें.** किसी भी वॉयस चैनल पर जाएं और तत्काल ही (क्योंकि रॉकेट की इमोजी जो है-आप तो समझते हैं) एक खास हैंगआउट के लिए कोई Watch Together प्लेलिस्ट या Putt Party गेम शुरू करें. आपके पास Nitro है? तब तो आपको एक्टिविटी के पूरे कैटलॉग मिलने के साथ अपने दोस्तों पर झुकने की ज़िम्मेदारी भी मिलेगी. पूरी कहानी जानने के लिए हमारे [ब्लॉग](https://discord.com/blog/server-activities-games-voice-watch-together) पर जाएं. \n* **पेश है Nitro Basic.** ये Nitro का सबसे छोटा वर्शन है जिसकी कीमत भी बहुत कम है. कहीं पर भी सारे इमोजी अनलॉक करें, ज़्यादा बड़ी फ़ाइलें अपलोड करके और भी बहुत कुछ करें. अब ज़्यादातर देशों में उपलब्ध है, और देश भी जुड़ रहे हैं.\n* **नया Nitro पर्क: प्रोफ़ाइल थीम.** अपनी प्रोफ़ाइल को खास बनाने के लिए रंगों की स्कीम चुनें. ये जल्दी ही उन सबकी यूज़र सेटिंग में उपलब्ध होगा जिनके पास Nitro है.\n* **सुनो, सुनो, सुनो, अब फ़ोरम चैनल भी आ गए हैं दोस्तो.** एक क्लासिक फ़ीचर अब नए रूप में. एक ही टॉपिक की ज़ंजीरों से खुद को आज़ाद करें, क्योंकि आपके दिमाग में अक्सर एक से ज़्यादा बातें और बहुत सारे खयाल होते हैं.\n* **नई [App Directory](https://discord.com/blog/app-directory-is-here-mods-and-admins) से सीधे अपने सर्वर पर ऐप जोड़ें.** Discord डिवेलपर कम्युनिटी ऐसी शानदार चीज़ें बनाती है जो आपके सर्वर को आपके लिए एकदम सही बना देती हैं. तो हम सोच रहे थे कि… उन्हें खोजना आसान होना चाहिए, है न? तो अब ऐसा हो चुका है. अगर आप किसी सर्वर को मैनेज करते हैं, तो बस सर्वर सेटिंग्स में जाएं और पता करें.\n* **Xbox पर Discord वॉयस अब सबके लिए उपलब्ध है.** हां, सच में. फ़्रेंड्स देख पाएंगे कि आप अपने कंसोल पर कौन सा गेम खेल रहे हैं और अब आप अपने Xbox से Discord वॉयस में उनसे बात कर सकेंगे, कई सालों से आपकी यही तो मांग थी. आपने इतना सब्र रखा इसके लिए धन्यवाद. इसके बारे में ज़्यादा जानकारी के लिए [ब्लॉग](https://dis.gd/xbox-voice) पर जाएं. \n\nसेटिंग के अपडेट {progress}\n======================\n\n* **अब रैंडम मैसेज फ़िल्टर हो जाते हैं.** अगर किसी ऐसे व्यक्ति ने आपको DM भेजा है जो आपकी फ़्रेंड लिस्ट में नहीं है, तो आपको वो मैसेज एक अलग मैसेज रिक्वेस्ट फ़ोल्डर में दिखाई देगा. अगर आप चाहते हैं कि हर कोई आपको मैसेज भेज सके, तो आप [इसे बंद कर सकते हैं](https://support.discord.com/hc/articles/7924992471191-Message-Requests).\n* **आप अपने हाइलाइट नोटिफ़िकेशन भी मैनेज कर सकते हैं.** आपके पसंदीदा सर्वर में क्या चल रहा है उसकी जानकारी रखें—या आपका मन नहीं है तो [ध्यान न दें](https://support.discord.com/hc/articles/5304469213079-Highlights-Notifications). जो मर्ज़ी करें.\n* **कम्युनिटी सर्वर में स्पैम का पता और अच्छी तरह लगाया जाएगा.** अगर किसी ने @mentions में स्पैम किया या किसी स्कैम का लिंक पोस्ट किया, तो AutoMod उन मैसेज को पोस्ट होने से पहले ही ब्लॉक कर देगा. सर्वर सेटिंग्स में जाकर कम्युनिटी के एडमिन इसे मैनेज कर सकते हैं.\n* **आपने जिन डिवाइस से लॉग इन किया है उन्हें देखें.** यूज़र सेटिंग › डिवाइस में जाकर आप अपने पारिवारिक कम्प्यूटर से या सदियों पुराने किसी फ़ोन से लॉग आउट कर सकते हैं.\n\n\n---changelog---\ndate: "2022-11-01"\nlocale: "hr-hr"\nrevision: 1\nyoutube_video_id: "8jD0dkCgF7k"\n---\nNove značajke {added marginTop}\n======================\n\n* **Aktivnosti su od sada s nama.** Pridruži se bilo kojem glasovnom kanalu i trenutno pokreni (radi se o raketi, razumiješ) popis za reprodukciju Watch Together ili igru Putt Party radi ugodnog druženja. Imaš Nitro? Dobit ćeš cijeli katalog Aktivnosti i teško će ti pasti što ćeš se morati praviti važnim pred prijateljima. Cijelu priču možeš pronaći na [blogu](https://discord.com/blog/server-activities-games-voice-watch-together). \n* **Predstavljamo Nitro Basic.** Povijesno najmanji Nitro za još manju cijenu. Otključaj sve emojije, prenosi veće datoteke i još mnogo toga. Od sada dostupno u većini država, a uskoro i u više njih.\n* **Nova posebna pogodnost za Nitro: Teme profila.** Odaberi shemu boja i istakni svoj profil. Uskoro dostupno u Korisničkim postavkama svima koji koriste Nitro.\n* **Pažnja, pažnja, dostupni su Kanali foruma i baš smo svi sretni, jelda?** Naša verzija klasika. Oslobodi se okova jedne teme jer imaš mnoštvo tema i previše misli.\n* **Na svoj server dodaj aplikacije putem nove opcije [App Directory](https://discord.com/blog/app-directory-is-here-mods-and-admins).** Zajednica developera za Discord stvara vrhunske stvari da bi tvoj server funkcionirao. A mi smo se malo pitali... ne bi li se serveri trebali pronaći lakše? Od sada se mogu. Ako upravljaš serverom, otvori Postavke servera i pogledaj što tamo ima.\n* **Discord Voice na Xbox-u sada je dostupan za sve.** DA, OZBILJAN SAM. Prijatelji mogu vidjeti koju igru igraš na svojoj konzoli i SADA MOŽEŠ RAZGOVARATI PUTEM USLUGE DISCORD VOICE PUTEM SVOG XBOX-A BAŠ ONAKO KAO ŠTO SI GODINAMA TRAŽIO. HVALA TI NA STRPLJENJU. Doznaj više na [blogu](https://dis.gd/xbox-voice). \n\nAžuriranja postavki {progress}\n======================\n\n* **Nasumične su poruke sada filtrirane.** Ako ti korisnik koji nije na popisu prijatelja pošalje direktnu poruku, možeš je vidjeti u odvojenoj mapi Zahtjevi za poruke. Ako ti ne smetaju poruke nepoznatih osoba, možeš [isključiti opciju](https://support.discord.com/hc/articles/7924992471191-Message-Requests).\n* **Možeš upravljati svojim obavijestima o istaknutom sadržaju.** Ostani u tijeku s trenutnim događajima na omiljenim serverima ili [ne](https://support.discord.com/hc/articles/5304469213079-Highlights-Notifications), ako ti se to ne sviđa. Radi po svojem.\n* **Poboljšano otkrivanje neželjenih poruka na Serverima zajednice.** Ako netko pokuša neželjeno označavati @spominjanja ili objaviti neželjenu poveznicu, AutoMod može blokirati objavu poruke. Administratori zajednice mogu upravljati tim opcijama tako da otvore Postavke servera.\n* **Možeš prikazivati uređaje na koje si prijavljen.** Pogledaj Korisničke postavke › Uređaji, divno mjesto gdje se možeš odjaviti iz obiteljskog računala ili prastarog mobitela.\n\n\n---changelog---\ndate: "2022-11-01"\nlocale: "hu-hu"\nrevision: 1\nyoutube_video_id: "8jD0dkCgF7k"\n---\nÚj funkciók {added marginTop}\n======================\n\n* **Mostantól a Tevékenységek funkció emeli a partik fényét.** Ha belépsz valamelyik hangcsatornára, fénysebességgel elindíthatsz egy Watch Together lejátszási listát vagy egy Putt Party játékot, hogy igazán emlékezetes legyen a lazulás. Van Nitro-előfizetésed? A komplett Tevékenységek katalógusból szemezgethetsz, a barátaid pedig garantáltan elsárgulnak majd az irigységtől. A [blogon](https://discord.com/blog/server-activities-games-voice-watch-together) elolvashatod a teljes sztorit. \n* **Bemutatjuk a Nitro Basic előfizetést.** Ez a Nitro legkompaktabb verziója, és az ára is igazán szerény. Az előfizetéssel többek között mindenhol feloldhatod az összes emotikont, és nagyobb fájlokat tölthetsz fel. A legtöbb országban már elérhető, és a lista hamarosan bővülni fog.\n* **Új Nitro-jutalom: profiltémák.** Válassz egy színpalettát a profilod kiemeléséhez. A funkció hamarosan minden Nitro-előfizető számára elérhető lesz a Felhasználói beállítások területen.\n* **Figyelem, figyelem… Megérkeztek a Fórumcsatornák.** Egy klasszikus formátum a saját stílusunkban. Ne korlátozd magad egyetlen témára: ennél sokkal több rejlik benned. Oszd meg a gondolataidat másokkal!\n* **Egyenesen az új [Alkalmazáskönyvtárból](https://discord.com/blog/app-directory-is-here-mods-and-admins) adhatsz hozzá alkalmazásokat a szerveredhez.** A Discord fejlesztői közössége nagyszerű megoldásokat állít össze, amelyekkel teljesen az igényeidre szabhatod a szervert. Úgy gondoltuk, ideje ezeket könnyebben hozzáférhetővé tenni, és már meg is valósítottuk az ötletet. Ha van olyan szerver, amelyet te kezelsz, lépj a Szerverbeállítások területre, és nézz körül!\n* **Most már mindenki számára elérhetők a Discord-hangcsevegések az Xboxon.** NEM CSALÁS, NEM ÁMÍTÁS. A barátaid láthatják, milyen játékkal játszol a konzolodon, és DISCORD-HANGCSEVEGÉST FOLYTATHATSZ AZ XBOXODRÓL. A FELHASZNÁLÓK ÉVEK ÓTA KÉRTÉK EZT A FEJLESZTÉST. MOST MEGÉRKEZETT. KÖSZÖNJÜK A TÜRELMET. További tájékoztatás a [blogon](https://dis.gd/xbox-voice). \n\nBeállításokkal kapcsolatos újdonságok {progress}\n======================\n\n* **Mostantól kiszűrjük a random üzeneteket.** Ha olyan személy küld neked közvetlen üzenetet, aki nem a barátod, a különálló Üzenetkérelmek mappában tekintheted meg, mit írt. Ha viszont nem bánod, ha bárki üzenetet tud küldeni neked, [kikapcsolhatod a beállítást](https://support.discord.com/hc/articles/7924992471191-Message-Requests).\n* **Kiemelt értesítéseket kezelhetsz.** Ha szeretnéd, folyamatosan figyelemmel kísérheted, mi történik a kedvenc szervereiden. Ha viszont [nincs](https://support.discord.com/hc/articles/5304469213079-Highlights-Notifications) igényed erre, nem kötelező használni ezt a funkciót. A döntés a te kezedben van.\n* **Mostantól még hatékonyabban fogjuk észlelni a kéretlen tartalmakat a közösségi szervereken.** Ha valaki kéretlen említésekkel (@mentions) próbálkozik, vagy kéretlen hivatkozást tesz közzé, az AutoMod megakadályozhatja az üzenet közzétételét. A közösségi adminok a Szerverbeállítások területen tudják kezelni ezt a funkciót.\n* **Megtekintheted, milyen eszközökön vagy bejelentkezve.** Lépj a Felhasználói beállítások › Eszközök területre. Ez egy igazán hasznos kis hely, ahol kijelentkezhetsz a családi gépről vagy az ősrégi telefonodról.\n\n\n---changelog---\ndate: "2022-12-07"\nlocale: "it"\nrevision: 1\nyoutube_video_id: "U0gEQNf8Hxw"\n---\nÈ tempo della neve {added marginTop}\n======================\n\n* **Snowsgiving è arrivato!** Ogni anno celebriamo le festività natalizie raccogliendo fondi per beneficenza e condividendo un po\' di allegria con la nostra fantastica community. [Visita il nostro sito web](https://discord.com/snowsgiving) per pillole giornaliere, esclusive Nitro e una sorpresa speciale extra il 13/12. (Suggerimento: probabilmente vorrai un posto in prima fila.)\n* **Nuovo merchandising per una buona causa.** Stiamo donando il 100% dei profitti di questo mese ricavati dalla nostra limitata [raccolta Snowsgiving](https://bit.ly/3P1FCww) al nostro partner Crisis Text Line.\n* **Le attività con tanto spirito natalizio.** Accedi a qualsiasi canale vocale per provare Bobble League on Ice a tema invernale. Gli abbonati Nitro possono anche lanciare Sketch Heads, Chess e Checkers innevati. [Scopri di più](https://discord.com/blog/server-activities-games-voice-watch-together).\n\n\n---changelog---\ndate: "2022-12-07"\nlocale: "ja"\nrevision: 1\nyoutube_video_id: "U0gEQNf8Hxw"\n---\n雪遊びの時間だ！ {added marginTop}\n======================\n\n* **Snowsgivingが来たー！**毎年、私たちは慈善のためのチャリティーを行い、私たちの素晴らしいコミュニティと喜びを共有することによって、ホリデーシーズンを祝っています。毎日のドロップ、Nitro特典、そして12月13日に登場するとっておきなサプライズを、[私たちのWEBサイト](https://discord.com/snowsgiving)からご覧ください(ヒント: あなたはきっと最前列の席を確保したいと思うでしょう）。\n\n* **新グッズストアで寄付をしよう** 私たちは今月の利益の100％を私たちのパートナーであるCrisis Text Lineに、期間限定[Snowsgivingコレクション](https://bit.ly/3P1FCww)から寄付しています。\n* **冬をテーマにした氷上のBobble Leagueをプレイできます。好きなボイスチャンネルに入ってください。Nitro加入者は雪をイメージしたSketch Heads、Chess、Checkersを起動することもできます[詳細はこちら](https://discord.com/blog/server-activities-games-voice-watch-together)。\n\n\n---changelog---\ndate: "2022-11-01"\nlocale: "ko"\nrevision: 1\nyoutube_video_id: "8jD0dkCgF7k"\n---\n새 기능 {added marginTop}\n======================\n\n* **활동이 생겼어요.** 아무 음성 채널에 들어가서 로켓답게 즉시 Watch Together 재생목록 또는 Putt Party 게임을 시작하고 아늑하게 어울리세요. Nitro가 있나요? 활동 카탈로그 전체가 제공되니 친구들에게 꼭 자랑하세요. [블로그](https://discord.com/blog/server-activities-games-voice-watch-together)에서 자세히 알아볼 수 있어요. \n* **Nitro Basic이 나왔어요.** 가장 작은 Nitro를 가장 저렴한 가격에 드려요. 모든 이모티콘을 어디서나 사용, 대용량 업로드 등 혜택이 있어요. 대부분의 국가에서 판매하며 곧 더 많은 국가에 출시할 거예요.\n* **새로운 Nitro 특전: 프로필 테마.** 색상 구성을 선택해 프로필을 강조하세요. 곧 모든 Nitro 사용자의 사용자 설정에 출시될 거예요.\n* **포럼 채널이 왔소이다...** 클래식을 재현해봤어요. 하나의 주제에만 매이지 말고 자유롭게 이야기하세요. 여러분은 너무 많은 생각과 개성을 가지고 있으니까요.\n* **새로운 [App Directory](https://discord.com/blog/app-directory-is-here-mods-and-admins)에서 즉시 서버에 앱을 추가하세요.** Discord 개발자 커뮤니티는 서버 운영을 간소화하는 훌륭한 도구를 만들어요. 그러니까... 그런 도구를 찾기 쉬워야겠죠? 이제 쉬울 거예요. 서버 운영자라면 서버 설정에서 확인해보세요.\n* **Xbox의 Discord 음성을 이제 누구나 사용할 수 있어요.** 정말이랍니다. 이제부터 콘솔에서 친구들이 플레이하고 있는 게임을 확인할 수 있고, 여러분이 몇 년 동안 요청하신 대로 Xbox에서 Discord로 대화할 수 있어요. 기다려주셔서 고마워요. [블로그](https://dis.gd/xbox-voice)에서 자세히 알아보세요. \n\n설정 업데이트 {progress}\n======================\n\n* **이제 랜덤 메시지가 필터링돼요.** 친구가 아닌 사람이 다이렉트 메시지를 보내면 별도의 메시지 요청 폴더에서 볼 수 있어요. 모르는 사람의 메시지를 받고 싶다면 [이 기능을 끄세요](https://support.discord.com/hc/articles/7924992471191-Message-Requests).\n* **하이라이트 알림을 관리할 수 있어요.** 좋아하는 서버의 최신 소식을 볼지, [안 볼지](https://support.discord.com/hc/articles/5304469213079-Highlights-Notifications) 선택할 수 있어요. 선택은 자유예요.\n* **커뮤니티 서버의 스팸 감지 기능을 강화했어요.** @mentions을 스팸하거나 사기성 링크를 게시하려고 하면, AutoMod가 메시지 포스트를 차단할 수 있어요. 커뮤니티 관리자가 서버 설정에서 이 기능을 관리할 수 있어요.\n* **로그인한 기기를 확인할 수 있어요.** 사용자 설정 › 기기를 확인해보세요. 가족 컴퓨터나 오래된 휴대폰에서 로그아웃할 수 있어요.\n\n\n---changelog---\ndate: "2022-11-01"\nlocale: "lt-lt"\nrevision: 1\nyoutube_video_id: "8jD0dkCgF7k"\n---\nNaujos funkcijos {added marginTop}\n======================\n\n* **Pasisveikinkite su veiklomis.** Keliauk į bet kurį balso kanalą ir iškart paleisk (kaip raketą – nevykęs juokelis, ar ne?) grojaraštį Watch Together arba žaidimą Putt Party smagiam laiko praleidimui. Turi Nitro? Tada tau pasiekiamas visas veiklų katalogas ir pati sunkiausia dalis – pasimaivyti prieš draugus. Apie tai išsamiau rasi [tinklaraštyje](https://discord.com/blog/server-activities-games-voice-watch-together). \n* **Pristatome Nitro Basic.** Mažiausia Nitro versija už dar mažesnę kainą. Gauk visus jaustukus bet kur, įkelk didesnius failus ir ne tik. Dabar – daugumoje šalių, sąrašas netrukus pasipildys.\n* **Naujas Nitro pranašumas: profilio temos.** Pasirink savo profilio spalvų schemą. Netrukus bus pasiekiama naudotojo nustatymuose visiems, kas turi Nitro.\n* **Jūsų pageidavimu – Forumų kanalai.** Mūsų patobulinta klasika. Išsilaisvink iš vienos temos pančių – juk turi daugybę minčių pačiomis įvairiausiomis temomis.\n* **Pridėk programėlių prie serverio tiesiai iš naujojo katalogo [App Directory](https://discord.com/blog/app-directory-is-here-mods-and-admins).** Discord programuotojų bendruomenė kuria nuostabių dalykų, paįvairinančių serverius. Tada pagalvojom: kažkaip sudėtinga juos rasti. Todėl šiek tiek pasidarbavome. Jei tvarkai kokį nors serverį, nueik į serverio nustatymus ir užmesk akį.\n* **Discord pokalbiai balsu per Xbox jau prieinami kiekvienam.** ČIA RIMTAI, NEJUOKAUJU. Draugai gali matyti, kokį žaidimą žaidi konsolėje, ir jau GALI PRISIJUNGTI PRIE JŲ PER DISCORD POKALBĮ BALSU TIESIAI IŠ XBOX – KAIP DAUGELIS PRAŠĖ JAU NE VIENERIUS METUS. AČIŪ UŽ KANTRYBĘ. Sužinok daugiau [tinklaraštyje](https://dis.gd/xbox-voice). \n\nNustatymų naujienos {progress}\n======================\n\n* **Atsitiktinės žinutės dabar filtruojamos.** Jei kas nors ne iš draugų išsiųs tau AŽ, ją matysi atskirame aplanke Žinučių užklausos. Jei tau netrukdo žinutės nuo bet ko, gali šią funkciją [išjungti](https://support.discord.com/hc/articles/7924992471191-Message-Requests).\n* **Gali tvarkyti svarbiausių akcentų pranešimus.** Žinok viską, kas svarbaus vyksta tavo mėgstamuose serveriuose – arba [nežinok](https://support.discord.com/hc/articles/5304469213079-Highlights-Notifications), jei nenori. Nuspręsk pats (pati).\n* **Dar geresnis brukalo aptikimas bendruomenės serveriuose.** Jei kas nors bando siųsti brukalą naudodamasis @paminėjimais arba įkelti apgaulingą nuorodą, AutoMod tokią žinutę gali užblokuoti. Šią funkciją serverio nustatymuose gali keisti bendruomenės administratoriai.\n* **Peržiūrėk įrenginius, kuriuose esi prisijungęs.** Eik į Naudotojo nustatymai › Įrenginiai – čia galėsi atsijungti iš šeimos kompiuterio ar milijono metų senumo telefono.\n\n\n---changelog---\ndate: "2022-11-01"\nlocale: "nb-no"\nrevision: 1\nyoutube_video_id: "8jD0dkCgF7k"\n---\nNytt innhold {added marginTop}\n======================\n\n* **Aktiviteter er med på moroa.** Gå til en talekanal for å starte en Watch Together-spilleliste eller en morsom runde med Putt Party. Har du Nitro? Du får tilgang til hele Aktiviteter-katalogen og får det tunge ansvaret med å underholde vennene dine. På [bloggen](https://discord.com/blog/server-activities-games-voice-watch-together) finner du alt du trenger å vite. \n* **Vi presenterer Nitro Basic.** Den minste versjonen av Nitro, for en minipris. Du låser opp alt av emojier overalt, kan laste opp større filer og mye mer. Tilgjengelig i de fleste land, og flere kommer snart til.\n* **Ny Nitro-fordel: Profiltemaer.** Velg et fargetema for å gjøre profilen din stiligere. Alle som har Nitro, får snart tilgang til dette i brukerinnstillingene.\n* **Vi har fått forumkanaler!** Dette er vår variant av klassikeren. Du er ikke bundet til ett emne, men kan diskutere alt hjertet renner over med.\n* **Legg til apper i serveren rett fra nye [App Directory](https://discord.com/blog/app-directory-is-here-mods-and-admins).** Discords utviklerfellesskap lager flotte ting som gjør at det blir enda morsommere og mer effektivt å bruke serveren. Men burde det ikke vært lettere å finne alt? Nå er det blitt det. Hvis du administrerer en server, kan du gå til Innstillinger for å ta en titt.\n* **Discord Voice på Xbox er tilgjengelig for alle.** JA, DET ER SANT. Vennene dine kan se hva du spiller på konsollen din, og DU KAN SNAKKE MED DEM PÅ DISCORD FRA XBOX-EN DIN, AKKURAT SOM DU HAR HATT LYST TIL I ÅREVIS. TAKK FOR TÅLMODIGHETEN. Du finner mer info på [bloggen](https://dis.gd/xbox-voice). \n\nOppdatering av innstillinger {progress}\n======================\n\n* **Nå filtreres meldinger fra brukere du ikke kjenner.** Hvis noen du ikke er venn med, sender deg en direktemelding, kan du velge å få den i en egen mappe: Meldingsforespørsler. Hvis du synes det er greit at folk sender deg meldinger, kan du [slå av funksjonen](https://support.discord.com/hc/articles/7924992471191-Message-Requests).\n* **Du kan administrere varsler av høydepunkter.** Få med deg hva som skjer på favorittserverne dine – eller [ikke](https://support.discord.com/hc/articles/5304469213079-Highlights-Notifications), hvis du helst vil slippe. Alle er ulike.\n* **Forbedret spamregistrering i fellesskapsservere.** Hvis noen prøver å spamme @mentions eller legge ut en farlig lenke, kan AutoMod blokkere meldingen, slik at den ikke publiseres. Fellesskapets administratorer kan justere dette i serverinnstillingene.\n* **Vis enheter der du er logget på.** Sjekk Brukerinnstillinger > Enheter, et nydelig sted der du kan logge ut på familiens datamaskin eller på en telefon du hadde for en million år siden.\n\n\n---changelog---\ndate: "2022-12-07"\nlocale: "pl"\nrevision: 1\nyoutube_video_id: "U0gEQNf8Hxw"\n---\nWitaj w Snowsgiving 2022 {added marginTop}\n======================\n\n* ** Nadeszło Snowsgiving! ** Każdego roku obchodzimy sezon świąteczny poprzez zbieranie funduszy na cele charytatywne i dzielenie się radością z naszą niesamowitą społecznością. [Odwiedź naszą stronę internetową](https://discord.com/snowsgiving) dla codziennych dropów, produktów Nitro i jednej specjalnej niespodzianki w dniu 13.12. (Wskazówka: prawdopodobnie będziesz chciał siedzieć w pierwszym rzędzie).\n* **Nowe produkty w szczytnym celu.** Przekazujemy 100% zysków z tego miesiąca z naszej limitowanej [kolekcji Snowsgiving](https://bit.ly/3P1FCww) dla naszego partnera Crisis Text Line. \n* Wpadnij na dowolny kanał głosowy, aby wypróbować zimową Bobble League on Ice. Abonenci Nitro mogą również uruchomić śnieżne gry Sketch Heads, Chess i Checkers. [Dowiedz się więcej](https://discord.com/blog/server-activities-games-voice-watch-together).\n\n\n---changelog---\ndate: "2022-12-07"\nlocale: "pt-BR"\nrevision: 1\nyoutube_video_id: "U0gEQNf8Hxw"\n---\nÉ a Hora da Neve {added marginTop}\n======================\n\n* **Snowsgiving chegou!** Todos os anos, celebramos a temporada de festas arrecadando fundos para caridade e compartilhando um pouco de alegria com nossa incrível comunidade. [Visite nossa página](https://discord.com/snowsgiving) para recompensas diárias, exclusividades para o Nitro, e uma surpresa especial no dia 13/12. (Dica: você provavelmente vai querer ficar na primeira fila)\n* **Novos produtos por uma boa causa.** Estamos doando 100% dos lucros deste mês de nossa coleção[limitada do Snowsgiving](https://bit.ly/3P1FCww) para nossos parceiros da Crisis Text Line. \n* **Atividades com espírito das festas.** Dê um pulo em qualquer canal de voz para experimentar Bobble League on Ice com tema de inverno. Assinantes Nitro também poderão participar as versões nevadas de Sketch Heads, Chess e Checkers. [Leia mais](https://discord.com/blog/server-activities-games-voice-watch-together).\n\n\n---changelog---\ndate: "2022-11-01"\nlocale: "ro-ro"\nrevision: 1\nyoutube_video_id: "8jD0dkCgF7k"\n---\nCaracteristici noi {added marginTop}\n======================\n\n* **Activitățile s-au alăturat petrecerii.** Intră pe orice canal de voce și lansează instantaneu (ca o rachetă, te prinzi tu) un playlist Watch Together sau un joc Putt Party, dacă vrei o întâlnire relaxată. Ai Nitro? Poți accesa tot catalogul de Activități și ai datoria solemnă de a te da mare în fața prietenilor. Citește toată povestea [pe blog](https://discord.com/blog/server-activities-games-voice-watch-together). \n* **Îți prezentăm Nitro Basic.** Cea mai mică versiune de Nitro, acum la un preț și mai mic. Deblochează toate emojiurile ca să le folosești oriunde, încarcă fișiere mai mari și nu numai. Nitro Basic e acum disponibil în majoritatea țărilor și va fi disponibil în și mai multe locuri în curând.\n* **Nou avantaj Nitro: temele de profil.** Alege o combinație de culori pentru a-ți scoate profilul în evidență. Opțiunea va fi disponibilă în curând în Setări utilizator pentru toți cei care au Nitro.\n* **Cine are urechi să audă! Canalele forum sunt aici!** Versiunea noastră a unui concept clasic. Eliberează-te de restricțiile unui singur subiect; doar ești o persoană prea complexă, cu prea multe gânduri.\n* **Adaugă aplicații pe server direct din noul [App Directory](https://discord.com/blog/app-directory-is-here-mods-and-admins).** Comunitatea de dezvoltatori Discord creează lucruri grozave, cu ajutorul cărora îți faci serverul să meargă fix cum vrei. Așa că ne gândeam... nu c-ar fi bine să le și găsești mai ușor? De-acum, așa și e. Dacă gestionezi un server, mergi la Setările serverului ca să vezi despre ce e vorba.\n* **Toată lumea poate folosi acum canalele de voce Discord pe Xbox.** DA, PE BUNE. Prietenii tăi pot vedea ce joci pe consolă, iar acum POȚI SĂ VORBEȘTI CU EI PE CANALELE DE VOCE DE PE XBOX, AȘA CUM VREI DE ANI DE ZILE ÎNCOACE. ÎȚI MULȚUMIM PENTRU RĂBDARE. Află mai multe de pe [blog](https://dis.gd/xbox-voice). \n\nActualizări setări {progress}\n======================\n\n* **De acum încolo, mesajele primite aleatoriu vor fi filtrate.** Dacă cineva care nu se află în lista ta de prieteni îți trimite un mesaj direct, vei vedea mesajul într-un folder separat, Solicitări de mesaje. Dacă nu te deranjează să primești mesaje de la oricine, poți [dezactiva opțiunea](https://support.discord.com/hc/articles/7924992471191-Message-Requests).\n* **Îți poți gestiona notificările despre elementele importante.** Fii mereu la curent cu ce se petrece pe serverele tale favorite – sau [nu](https://support.discord.com/hc/articles/5304469213079-Highlights-Notifications), dacă n-ai chef. Cum vrei tu.\n* **Am amplificat detectarea spamului pe serverele comunitare.** Dacă cineva încearcă să spameze @mentions sau să posteze un link către un conținut înșelător, AutoMod poate bloca mesajul, nelăsându-l să fie postat. Administratorii comunității pot gestiona setarea din Setările serverului.\n* **Vezi dispozitivele de pe care te-ai conectat.** Intră pe Setări utilizator › Dispozitive, un loc minunat de unde poți să te deconectezi de pe calculatorul familiei sau de pe un telefon de acum o mie de ani.\n\n\n---changelog---\ndate: "2022-12-07"\nlocale: "ru"\nrevision: 1\nyoutube_video_id: "U0gEQNf8Hxw"\n---\nДа будет снег {added marginTop}\n======================\n\n* **Встречайте Snowsgiving.** Каждый год мы отмечаем праздничный сезон, собирая средства на благотворительность и делимся радостью с нашим замечательным сообществом. [Посетите наш веб-сайт](https://discord.com/snowsgiving), чтобы узнать о ежедневных наградах, эксклюзивах Nitro и одном специальном сюрпризе 13 декабря. (Подсказка: вам, вероятно, понадобится место в первом ряду.)\n* **Купите наш мерч, чтобы поддержать хорошее дело.** 100% прибыли Discord от нашей лимитированной [коллекции Snowsgiving](https://bit.ly/3P1FCww) будет пожертвовано нашему партнеру Crisis Text Line.\n* **Готовы к праздничному настроению?** Включите любой голосовой канал, чтобы попробовать зимнюю лигу Bobble League на льду. Подписчики Nitro также могут запускать снежные Sketch Heads, Chess и Checkers. [Подробнее](https://discord.com/blog/server-activities-games-voice-watch-together).\n\n\n---changelog---\ndate: "2022-12-07"\nlocale: "es-ES"\nrevision: 1\nyoutube_video_id: "U0gEQNf8Hxw"\n---\nEs temporada de nieve {added marginTop}\n======================\n\n* **¡Snowsgiving ha llegado!** Todos los años celebramos las fiestas recaudando fondos para obras benéficas y compartiendo un poco de alegría con nuestra increíble comunidad. [Visita nuestro sitio web](https://discord.com/snowsgiving) para ver los drops diarios, las exclusividades de Nitro y una sorpresa muy especial el 13 de diciembre. (Pista: probablemente querrás un asiento en primera fila.)\n* **Nueva mercancía por una buena causa.** Donaremos el 100% de los ingresos de este mes de nuestra [colección limitada de Snowsgiving](https://bit.ly/3P1FCww) a Crisis Text Line. \n* **Las actividades se contagiaron del espíritu navideño.** Entra en cualquier canal de voz para probar Bobble League on Ice de temática invernal. Los suscriptores de Nitro también pueden disfrutar de Sketch Heads, Chess y Checkers con temática invernal. [Aprende más](https://discord.com/blog/server-activities-games-voice-watch-together).\n\n\n---changelog---\ndate: "2022-12-07"\nlocale: "sv-SE"\nrevision: 1\nyoutube_video_id: "U0gEQNf8Hxw"\n---\nVälkommen till Snowsgiving 2022 {added marginTop}\n======================\n\n* **Snowsgiving har anlänt!** Varje år firar vi högtidssäsongen genom att samla in pengar till välgörenhet och fira tillsammans med vårt fantastiska community. [Besök vår hemsida](https://discord.com/snowsgiving) för dagliga belöningar, Nitro-exklusiviteter och en extra överraskning den 13:e december. (Ledtråd: du kommer antagligen vilja sitta på främsta raden.)\n* **Handla merch för att stödja ett gott ändamål.** 100% av Discords vinst från vår begränsade kollektion kommer doneras till vår partner Crisis Text Line. [Besök vår Merchaffär]($merchURL)\n* **Redo för högtidsfirande? Kolla dina DMs.** Du hittar med information om Snowsgiving i din [vänlista]($deeplink).\n\n\n---changelog---\ndate: "2022-12-07"\nlocale: "th-th"\nrevision: 1\nyoutube_video_id: "U0gEQNf8Hxw"\n---\nถึงเวลาหิมะตกแล้ว {added marginTop}\n======================\n\n* **Snowsgiving มาถึงแล้ว!** ทุกปีเราเฉลิมฉลองเทศกาลวันหยุดด้วยการระดมทุนเพื่อการกุศลและแบ่งปันกำลังใจกับชุมชนที่น่าทึ่งของเรา [เยี่ยมชมเว็บไซต์ของเรา](https://discord.com/snowsgiving) for เพื่อรับรางวัลรายวัน Nitro สุดพิเศษ และอีกหนึ่งเซอร์ไพรส์พิเศษในวันที่ 12/13 (คำแนะนำ: คุณอาจต้องการที่นั่งแถวหน้า)\n* **สินค้าใหม่เพื่อการกุศล** เราบริจาค 100% ของกำไรของเดือนนี้จาก [คอลเลกชัน Snowsgiving](https://bit.ly/3P1FCww) ให้กับ Crisis Text Line ซึ่งเป็นพันธมิตรของเรา \n* **กิจกรรมที่มีจิตวิญญาณแห่งวันหยุด** เข้าสู่ช่องเสียงเพื่อลอง Bobble League on Ice ในธีมฤดูหนาว สมาชิก Nitro ยังสามารถเปิดตัว Sketch Heads, Chess และ Checkers ที่เต็มไปด้วยหิมะได้ [เรียนรู้เพิ่มเติม](https://discord.com/blog/server-activities-games-voice-watch-together)\n\n\n---changelog---\ndate: "2022-11-01"\nlocale: "tr"\nrevision: 1\nyoutube_video_id: "8jD0dkCgF7k"\n---\nYeni Özellikler {added marginTop}\n======================\n\n* **Etkinlikler partiye katıldı.** Dilediğin ses kanalına gir ve keyifli bir akşam için anında Watch Together izleme listesi veya Putt Party oyununu ateşle (roket gibi hani, çaktın mı?). Nitro aboneliğin de varsa Etkinlik kataloğunun tamamına erişebilir ve arkadaşlarına hiç içinden gelmese de hava atabilirsin. Detaylı bilgiler [blogda](https://discord.com/blog/server-activities-games-voice-watch-together). \n* **Karşında Nitro Basic.** Nitro\'nun en küçük versiyonu, hem de daha ucuza. Bu versiyonla tüm emojileri her yerde açabilir, daha büyük dosyalar yükleyebilir ve daha fazlasını yapabilirsin. Şimdiden çoğu ülkede etkin, diğer ülkelere de yakında gelecek.\n* **Yeni Nitro avantajı: Profil Temaları.** Profilini şenlendirmesi için bir renk şeması seç. Yakında Nitro abonesi herkesin Kullanıcı Ayarları\'na geliyor.\n* **Duyduk duymadık demeyin, Forum Kanalları geliyor.** Herkesin bildiği bu özelliği bir de bizde dene. Kendini tek bir konunun zincirlerinden kurtar çünkü sen birçok fikir barındıran komplike bir bireysin.\n* **Yeni [App Directory](https://discord.com/blog/app-directory-is-here-mods-and-admins) ile sunucuna kolayca uygulamalar ekle.** Discord Geliştirici topluluğu, sunucunun tam da istediğin gibi olması için süper şeyler üretiyor. Biz de bu şeyleri bulmanı kolaylaştıralım dedik. Sunucun varsa Sunucu Ayarları\'na giderek bu özelliği inceleyebilirsin.\n* **Xbox\'taki Discord Sesli Sohbet\'i artık herkes kullanabiliyor.** EVET, GAYET CİDDİYİM. Arkadaşlarının konsollarında hangi oyunu oynadığını görebilecek ve ARTIK YILLARDIR İSTEDİĞİN GİBİ XBOX ÜZERİNDEN ARKADAŞLARINLA DISCORD SESLİ SOHBET\'TE KONUŞABİLECEKSİNİZ. SABRIN İÇİN TEŞEKKÜRLER. Daha fazla bilgi [blogda](https://dis.gd/xbox-voice). \n\nAyarlar Güncellemeleri {progress}\n======================\n\n* **Rastgele mesajlar artık filtreleniyor.** Arkadaş olmadığın biri sana direkt mesaj gönderdiğinde dilersen bu mesaj ayrı bir Mesaj İstekleri klasörüne geliyor. Bunun olmasını istemezsen bu ayarı [kapatabilirsin](https://support.discord.com/hc/articles/7924992471191-Message-Requests).\n* **Öne Çıkarma bildirimlerini artık yönetebiliyorsun.** En sevdiğin sunucularda olup biteni takipte kal veya [kalma](https://support.discord.com/hc/articles/5304469213079-Highlights-Notifications). Sana kalmış, karar senin.\n* **Topluluk sunucularındaki spam tespitini geliştirdik.** Biri @bahsetmeleri spam\'ler veya sahtecilik amaçlı bir bağlantı gönderirse artık AutoMod bu mesajın gönderilmesini engelleyebiliyor. Topluluk yöneticileri bu özelliği Sunucu Ayarları\'nda inceleyebilir.\n* **Oturum açtığın cihazları artık görebilirsin.** Kullanıcı Ayarları > Cihazlar sekmesine bir göz at çünkü burası aile bilgisayarındaki veya tarih öncesinden kalma telefonundaki oturumunu kapatabileceğin büyülü bir yer.\n\n\n---changelog---\ndate: "2022-11-01"\nlocale: "ua-ua"\nrevision: 1\nyoutube_video_id: "8jD0dkCgF7k"\n---\nНові можливості {added marginTop}\n======================\n\n* **На нашому святі життя з\'явились активності!** Зазирнувши в будь-який голосовий канал, ви зможете миттєво запустити (як ракету) плейлист «Watch Together» або гру «Putt Party» та добре провести час. До речі, чи є у вас Nitro? Якщо да, то вам буде доступний повний каталог активностей та ви зможете хвалитися вашим друзям. Всі подробиці у нашому [блозі](https://discord.com/blog/server-activities-games-voice-watch-together). \n* **Зустрічайте Nitro Basic!** Найскромніший варіант передплати Nitro за ще більш скромною ціною. Ви зможете використовувати всі емодзі де завгодно та завантажувати файли більшого розміру, а також отримаєте ряд інших переваг. Цей тариф вже доступний в багатьох країнах, та скоро їх стане ще більше.\n* **Нова перевага Nitro: теми профілю.** Прикрасьте свій профіль, обравши для нього кольорову палітру! Теми скоро з\'явяться в розділі «Користувацькі налаштування» у всіх передплатників Nitro.\n* **Увага, увага, для вас ще одна перевага! ** В Discord з\'явились канали форумів — наш варіант класичних платформ для спілкування. Ви більше не вимушені обговорювати одну єдину тему для спілкування, адже у вашій голові стільки різноманітних думок та ідей!\n* **Додавайте програми на свій сервер з допомогою нового [каталогу програм (App Directory)](https://discord.com/blog/app-directory-is-here-mods-and-admins).** Спільнота розробників Discord створює круті штуки, щоб вам було простіше керувати сервером. І ми подумали...чому б не полегшити їх пошук? Та полегшили! Якщо ви маєте права на керування сервером, відкрийте його налаштування та зазирніть у каталог.\n* **Голосові канали Discord на Xbox стали доступними всім користувачам.** НІ, ЦЕ ВАМ НЕ ЖАРТИ. Тепер ваші друзі будуть бачити, яку гру ви запустили на своїй консолі, а ВИ ЗМОЖЕТЕ СПІЛКУВАТИСЯ З НИМИ В ГОЛОСОВОМУ ЧАТІ DISCORD НА XBOX, ТОМУ ЩО ДОВГО ЧЕКАЛИ НА ЦЮ ФУНКЦІЮ. Дякуємо вам за терпіння! Докладніше читайте в [блозі](https://dis.gd/xbox-voice). \n\nОновлення налаштувань {progress}\n======================\n\n* **Увімкнена фільтрація випадкових повідомлень.** Якщо хтось, хто не є вашим другом, відправить вам приватне повідомлення, воно з\'явиться в окремій папці «Запити спілкування». Якщо ви не проти отримувати повідомлення від незнайомих людей, спокійно [вимикайте](https://support.discord.com/hc/articles/7924992471191-Message-Requests) цю функцію.\n* **Тепер ви можете керувати сповіщеннями про важливі події.** Слідкуйте за тим, що відбувається на ваших улюблених серверах, або [ігноруйте](https://support.discord.com/hc/articles/5304469213079-Highlights-Notifications) їх, якщо вам таке не подобається. Обирайте те, що хочете.\n* **Посилена система виявлення спама на серверах спільнот.** Якщо хтось спробує спамити @спогадуваннями чи посиланнями на шахрайські сайти, AutoMod заблокує публікацію таких повідомлень. Адміністратори спільнот можуть керувати цією функцією в налаштуваннях сервера.\n* **Дізнайтеся, на яких пристроях ви виконали вхід.** Для цього перейдіть в розділ «Користувацькі налаштування» > «Пристрої». В цьому чудовому місці ви зможете вийти зі свого акаунта на сімейному комп\'ютері чи стародавньому смартфоні.\n\n\n---changelog---\ndate: "2022-12-07"\nlocale: "vi-vn"\nrevision: 1\nyoutube_video_id: "U0gEQNf8Hxw"\n---\nĐã đến lúc tuyết rơi {added marginTop}\n======================\n\n* **Snowsgiving đã đến!** Hàng năm, chúng tôi kỷ niệm mùa lễ hội bằng cách gây quỹ từ thiện và chia sẻ niềm vui với cộng đồng tuyệt vời của mình. [Truy cập trang web của chúng tôi](https://discord.com/snowsgiving) để nhận phần thưởng hàng ngày, phần thưởng Nitro độc quyền, và thêm một bất ngờ đặc biệt vào ngày 13/12. (Gợi ý: có thể bạn sẽ muốn ngồi ở hàng ghế đầu.)\n* **Hàng hóa mới tinh vì lý do chính đáng.** Chúng tôi sẽ quyên góp 100% lợi nhuận tháng này từ [bộ sưu tập Snowsgiving](https://bit.ly/3P1FCww) giới hạn của chúng tôi cho đối tác Crisis Text Line. \n* **Các hoạt động mang tinh thần ngày lễ.** Truy cập vào bất kỳ kênh thoại nào để thử Bobble League on Ice theo chủ đề mùa đông. Người đăng ký Nitro cũng có thể bật Sketch Heads, Chess, và Checkers đầy tuyết. [Tìm hiểu thêm](https://discord.com/blog/server-activities-games-voice-watch-together).\n\n\n---changelog---\ndate: "2022-12-07"\nlocale: "zh-CN"\nrevision: 1\nyoutube_video_id: "U0gEQNf8Hxw"\n---\n雪季到! {added marginTop}\n======================\n\n* **Snowsgiving 到了！**我们在每年都会藉由公益募款庆祝佳节，同时与我们最棒的社群分享这份喜悦。 【请确认我们的活动页面】(https://discord.com/snowsgiving) 以便了解每日掉宝，Nitro 订阅者限定奖励，以及只有在12月13日当天可以收到的一份神秘惊喜。 (友善提示：在活动当天您或许会想坐在最前面)\n* **藉由购买支持公益。** 我们将会将这个月份贩卖【Snowsgiving 周边限定商品】(https://bit.ly/3P1FCww) 所获得的收益全数捐给我们的合作伙伴 Crisis Text Line (危机短信热线)。\n* **充满佳节气息的游戏活动。** 參加入任何语音频道，以便尝试冬季版本的冰上 Bobble League 游戏。如果您是 Nitro 订阅者，还可以玩冰雪版本的 Sketch Heads (画图猜谜) ，西洋棋，以及西洋跳棋等游戏。 【详情请见】(https://discord.com/blog/server-activities-games-voice-watch-together)。\n\n\n---changelog---\ndate: "2022-12-07"\nlocale: "zh-TW"\nrevision: 1\nyoutube_video_id: "U0gEQNf8Hxw"\n---\n雪季來臨! {added marginTop}\n======================\n\n* **Snowsgiving 到了！**我們在每年都會藉由公益募款慶祝佳節，同時與我們最棒的社群分享這份喜悅。【請確認我們的活動頁面】(https://discord.com/snowsgiving) 以便了解每日掉寶，Nitro 訂閱者限定獎勵，以及只有在12月13日當天可以收到的一份神秘驚喜。 (友善提示：在活動當天您或許會想坐在最前面)\n* **藉由購買周邊商品支持公益。** 我們將會將這個月份販賣【Snowsgiving 周邊限定商品】(https://bit.ly/3P1FCww) 所獲得的收益全數捐給我們的合作夥伴 Crisis Text Line (危機簡訊熱線)。\n* **充滿佳節氛圍的遊戲活動。** 加入任何語音頻道，以便嘗試冬季版本的冰上 Bobble League 遊戲。如果您是 Nitro 訂閱者，還可以玩冰雪版本的 Sketch Heads (畫圖猜謎) ，西洋棋，以及西洋跳棋等遊戲。【詳情請見】(https://discord.com/blog/server-activities-games-voice-watch-together)。\n\n\n'
